function Change(n){n==`About`?(about.visibility="visible",portfolio.visibility="hidden",blog.visibility="hidden",about.height="auto",portfolio.height="0px",blog.height="0px"):n==`Portfolio`?(about.visibility="hidden",portfolio.visibility="visible",blog.visibility="hidden",portfolio.height="auto",about.height="0px",blog.height="0px"):n==`Blog`&&(about.visibility="hidden",blog.visibility="visible",portfolio.visibility="hidden",blog.height="auto",about.height="0px",portfolio.height="0px")}let about=document.getElementById("About").style,portfolio=document.getElementById("Portfolio").style,blog=document.getElementById("Blog").style;portfolio.visibility="hidden";blog.visibility="hidden";